import Heading from './Heading';
import OL from './OL';

function App(){
    return (  <>
        <Heading/>
        <OL/>
          <ul>
            <li>Agra</li>
            <li>Nagpur</li>
            <li>Ramtek</li>
            <li>Pune</li>
          </ul>
        </>)
}
